import React from 'react';
import './Home.css';


function Home(props) {
    return (
        <div className='home'>
            <h1 id='head'>Blog Application</h1>
            <p>Draft content directly within HubSpot’s blog editor. Quickly insert images, format headers, and add links with the on-page editor. You’ll rest easy knowing that every blog article is automatically optimized for mobile.</p>
        </div>
    );
}

export default Home;
